We consider the logistic map f(x) = λx(1 – x) on [0, 1]. The fixed points are given by f(x) = x, namely x = 0 and x = 1 – (1/λ) (when λ > 1). A 2-cycle (period-2 orbit) means there exists some x ∈ [0, 1] with f(f(x)) = x but f(x) ≠ x.

It is a well known fact for the logistic map that nontrivial 2-cycles emerge when the unique nonzero fixed point becomes unstable. A standard stability analysis shows that the fixed point x = 1 – (1/λ) loses stability as its derivative f′ at that point satisfies |f′(x)| > 1 once λ > 3. Therefore, for λ > 3 a period-doubling bifurcation occurs and a nontrivial 2-cycle appears. Since we restrict λ ≤ 4, the only values for λ that yield a 2-cycle (i.e. an x in [0,1] such that f(f(x)) = x but f(x) ≠ x) are those in the interval (3, 4].
